                settings.modal = $('<div />').attr(modalAttr.main).appendTo(zone);
                var dialog = $('<div />').attr(modalAttr.dialog).appendTo(settings.modal);
                var content = $('<div />').attr(modalAttr.content).appendTo(dialog);

